import React, { Component } from "react";
import './Header.css'

export default class Header extends Component {
  render() {
    return (
      <nav class="all-header-nav container flex-container">
        <h2 class="logo">
          <a class="all-logo-link" href="#">
            courson
          </a>
        </h2>
      </nav>
    );
  }
}
